description:
Verenigde Staten
Thriller
98 minuten

goed

met Jessica Alba, Parker Posey en Alessandro Nivola

Een meisje is al vanaf haar vijfde blind. Na een hoornvliestransplantatie wordt haar zicht beetje bij beetje hersteld. Eerst 
bijzonder wazig, maar daarna steeds scherper. Met het herstel wordt echter duidelijk dat niet alles wat ze ziet, er ook echt is. 
Er duiken mysterieuze schimmen op, die niemand anders kan zien. Ze keert zich voor hulp tot de psychiater die haar hielp met haar 
overstap naar de ziende wereld, en samen gaan ze op zoek naar de oplossing voor dit fenomeen.
